  \"2016-07-15T04:11:24.205912\",\n\t\"name\": \"collection-of-usaid-forward-indicators\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"USAID Forward is an effort to strengthen
  the Agency by embracing new partnerships, investing in the catalytic role of innovation
  and demanding a relentless focus on results. The FY 2012, FY 2013, FY 2014 and FY
  2015 data for each of the eight topline indicators chosen to monitor USAID's progress
  toward implementing its USAID Forward agenda is in a distinct spreadsheet.  The
  FY 2012 data was reported in the USAID Forward Progress Report 2013 data.  Indicators
  are included for each goal: Focused strategic planning, Improved decision making,
  Strengthen and retain the best talent, Strengthen local capacity, Strengthen staff
  capacity, Scale up & leverage private resources, Maximize resources by leveraging
  commercial private capital, and Accelerate financial inclusion.\",\n\t\"license_title\":
